    public int lengthOfLongestSubstring(String s) {
        int length = 0;
        int strLength = s.length();
        if (strLength == 0) {
            return 0;
        }

        boolean continuous = false;
        Set<Character> collection = new HashSet<>();
        for (int i = 0; i < strLength; i++) {
            char c = s.charAt(i);
            char previous = (i > 0) ? s.charAt(i - 1) : '\u0000';
            if (c == previous) {
                length++;
                continuous = true;
            } else {
                if (collection.contains(c) || continuous) {
                    return length;
                } else {
                    continuous = false;
                    collection.add(c);
                    length++;
                }
            }
        }

        return length;
    }
